  \"2016-02-27T17:19:06.752866\",\n\t\"name\": \"ssn-verification-service\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The SSN Verification Service is used by
  Java applications to execute the GUVERF02 service using the WebSphere/CICS Interface.
  It accepts several input data fields like First Name, Last Name, and Mother's Maiden
  Name and compares the data to the corresponding fields on the Numident record. SSN
  Verify Service can be invoked from WebSphere only through the CMM infrastructure.
  The Numident record is retrieved by calling the GUNSCHIP general utility. This service
  is currently being used by the appointment application to match input data with
  the information on the Numident.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
